// Menu.js
import React from 'react';
import classes from './Menu.module.css';
import logo from './logo.png';
import t1 from "./twitter.png";
import t2 from "./whatsapp.png";
import t3 from "./youtube.png";
import t4 from "./instagram.png";
import t5 from "./facbook(1).png";
import t6 from "./linkedin.png";

function Menu() {
  return (
    <div className={classes.pageContainer}>
      <div className={classes.menuContainer}>
        <div className={classes.logoContainer}>
          <img src={logo} alt="Logo" className={classes.logo} />
        </div>
        <ul className={classes.menuItems}>
          <li>
            <img src={t1} alt="Twitter" className={classes.icon} />
            Home
          </li>
          <li>
            <img src={t2} alt="WhatsApp" className={classes.icon} />
            About
          </li>
          <li>
            <img src={t3} alt="YouTube" className={classes.icon} />
            Services
          </li>
          <li>
            <img src={t4} alt="Instagram" className={classes.icon} />
            Projects/Clients
          </li>
          <li>
            <img src={t5} alt="Facebook" className={classes.icon} />
            Team
          </li>
          <li>
            <img src={t6} alt="LinkedIn" className={classes.icon} />
            Contact us
          </li>
          <li>Location</li>
          <li>Others</li>
        </ul>
      </div>
    </div>
  );
}

export default Menu;
